import React from 'react';
import s from'./Header.module.css'

const Header = () => {
  return (
      <header className={s.header}>
        <img src="https://zavod-mix.ru/wp-content/uploads/2017/02/logo-header-dark-retina.png"/>
      </header>
  );
};

export default Header;
